const Search = () => {
  return (
    <div>
      <div className="header">
        <div>
          <HeaderFirst></HeaderFirst>
        </div>
        <NavBar></NavBar>
        <Header></Header>
      </div>
      <div className="search__content">
        <SearchPopup></SearchPopup>
        <SearchList></SearchList>
      </div>
      <div className="footer">
        <Footer></Footer>
      </div>
    </div>
  );
};

export default Search;
